import * as SecureStore from 'expo-secure-store';

const saveTokenAsync = async (accessToken) => {
    try {
        await SecureStore.setItemAsync(
            'token',
            accessToken
        );
    } catch (error) {
        console.log("Error in saving Access Token: ", error);
    }
}
export default saveTokenAsync;
